            {/* Uncomment the following line if you have a 'name' property in your item */}
            {/* <h3>{item.name}</h3> */}

            <div className="imagesearch">
              {/* Uncomment the following lines if you have a 'link' property in your item */} */}
               <a href={item.link}>
                <img src="https://cdn.w600.comps.canstockphoto.com/right-arrow-flat-pink-icon-stock-image_csp40130369.jpg" alt="rightArrow" className="searchArrow" />
              </a>
            </div>
          </div>
        </div>
      ))}
    </>
  );
};

export default Pin;
